import { useDrag } from 'react-dnd';

const Champion = ({ image, position }) => {

  const [{ isDragging }, drag] = useDrag(() => ({
    type: 'champion',
    item: { id: image.id },
    collect: (monitor) => ({
      isDragging: !!monitor.isDragging()
    })
  }))

  return (
    <div ref={drag} style={{ 
      width: '50px', 
      height: '50px',
      borderRadius: '25px',
      backgroundImage: `url(${image.url})`,
      backgroundSize: 'cover',
      position: 'absolute',
      left: position.x,
      top: position.y 
    }}>
    </div>
  )
}

export default Champion;
